    animationDirector: "379 Rei MasunagaREMOVE_THIS_AND_REPLACE_WITH_/N_BUT_WITH_BACKSLASH380 Akiko Kawashima",
    characterDesign: "Mari TominagaREMOVE_THIS_AND_REPLACE_WITH_/N_BUT_WITH_BACKSLASHKeiko Sasaki (sub-character)REMOVE_THIS_AND_REPLACE_WITH_/N_BUT_WITH_BACKSLASHKumiko Shishido (design works)",
    productionCooperation: "380 Sunshine Corporation",
    voiceCast: "Minami Takayama as Conan Edogawa  Akira Kamiya as Kogoro Mouri  Wakana Yamazaki as Ran Mouri  Hiroshi Naka as Minoru Masaki  Isshin Chiba as Detective Tamura  Shin Aomori as Officer Ogura  Atsuko Mine as Kotoya Inn landlady  Naoki Makishima as Kotoya Inn clerk  Megumi Urawa as Student  Sayuri Yoshida as Child  Haruhi Tsumoto as Announcer  Haruna Ikezawa as Ema Anzai  Kaho Kōda as Asuka Shibasaki  Yuri Shiratori as Harumi Fukatsu  Tomomichi Nishimura as Kyoichi Bando  Mami Horikoshi as Yoriko Yasuda  Miki Itō as Eri Akechi  Rina Aiuchi as Herself",
    openingSong: "START",
    closingSong: "Wasurezaki",
    prevCase: "« Momotarou Mystery Solving Tour",
    nextCase: "Which One's Deduction Show »",
    resolution: "The group is later gathered at the spring where Asuka died, and are met with the legendary 'Sleeping Kogoro'. The first piece of evidence are the shallow footprints at Ema's crime scene were too shallow and were probably made by pressing the victim's in the snow, while the culprit moved around by using two planks that would be alternated as they moved in the snow. Sleeping Kogoro then points at the real culprit, ERI AKECHI, the romance novel writer. She had actually killed Asuka Shibasaki first and later Ema Anzai, so after she killed Asuka, she froze a set of obis and put the murder weapon and the doll on the frozen obis, which she let slide down the slope from the inn to the pond, which officer Ogura just demonstrates. This was why Kogoro and Conan heard a splashing sound during their late-nate bathing. The doll found in front of the women's bath was also a trick, and it was kept in place in the ceiling where there was a crack using dry ice, and after the dry ice melted, the doll would fall on the floor. When Eri protests and ask for evidence, Kogoro asks the police to examine her foot to find a bloodstain, which was caused by her stepping on Ema's earring, which is why it went missing. Finally found out, Eri Akechi, whose real name is CHIERI AKE (the kanji 明智 恵理 becomes 明 智恵理) confesses and explains what led her to commit the unthinkable. She and the dead Sakurako were sisters, whose parents died in a fire. While the Suzuka family only adopted Sakurako, the sisters managed to keep close contact during their childhood/teenage/young adult years until Eri, now a promising writer, moved to Boston for some time: the kind but frail Sakurako was framed for drug trade and committed suicide during these days, and Eri only found out a year later. Deeply hurt by Sakurako's death and how her younger sister never told her that she was in deep trouble, Eri made more research on the circumstances surrounding her suicide, finding out about her devotion to the Kimono Goddess and about Ema and Asuka. She then contacted her university classmate Yoriko to arrange a meeting between them, and then she killed the two as punishment for causing the death of her sister, using the Kimono Goddess legend not just to cover her tracks, but as a symbol of her revenge. Like the selfish girls from the legend who got Ohana executed to steal her kimonos and later were killed by her spirit, Asuka and Ema lost their lives for having used Sakurako as a scapegoat for their own crimes. Conan-through-Kogoro bitterly asks Eri if she believes that the kind Sakurako would have been satisfied with her revenge. He then adds that Sakurako's best friend Harumi was mourning for her death too but Eri did not take her feelings into consideration, when in fact Sakurako would have loved it if they had become friends. In front of a sobbing Harumi, Eri falls to her knees and breaks down in tears. Kogoro eventually wakes up and, being disorientated due to the heat and the effects of the dart, falls into the hot spring.",
    trivia: [
      "This is Koujin Ochi's last case written under his real name, Hirohito Ochi.",
      "The producer of the Detective Conan anime, Michihiko Suwa, disclosed in an interview with Minami Takayama, that the original author, Gosho Aoyama thinks the trick used in this case is fairly interesting.",
      "On the television in the hotel bar, the singer Rina Aiuchi sings START.",
      "The Kotoya Inn's van is a 2000 dark blue Toyota HiAce Commuter.",
      "The writers of this episode just came up with Eri Akechi's name by just using Eri Kisaki's given name and then Kogoro Akechi's family name. This is why Eri makes a comment about being embarrassed when she's called 'Akechi-sensei' since it sounds like people are referring to the fictional detective.",
      "The legend used to depict the series of murders is modeled from the Hannya legend and Yakumo Koizumi's Furisode.",
      "The vehicle that Kogoro, Ran, and Conan are riding in the first scene has a license plate of 38-66."
    ],
