    resolution: "Conan finds out that Kimura is not who he seems to be. Kimura is said to be at a lake and Kogoro goes to investigate. There he is seemingly shot by the culprit but, in fact Conan had set up a dummy in Kogoro's place.  ATTEMPTED MURDER      Location: Lake  Victim: Kogoro Mouri   Cause: Gunshot  Culprit: Inoue (Hiroshi Ukita)   Conan stuns Kogoro and reveals that the culprit was INOUE all along. Inoue is actually Hiroshi Ukita from the robbery case that Kogoro solved before. Ukita had gotten plastic surgery in order to look like someone else. He reveals that his motive was to get revenge on Kogoro, who arrested him because he had stolen money so he and his fiancé could get married. But once Kogoro had caught him, his life had been ruined and he never saw his fiancé again. Inspector Megure gets mad at him, and says that stealing is an unforgivable crime, and wouldn't have made his fiancé happy. Ukita gets arrested once again.",
