    nextCase: "Metropolitan Police Detective Love Story 6 »",
    resolution: "FUMIKO SHIRAISHI killed Tatsumura. Contrary to what they already believed, Tatsumura was actually killed somewhere else, not at his house. Fumiko tricked Tatsumura to meet him somewhere else and killed him with the same murder weapon found in his house. She also got his blood taken and spilled it in his house floor and the murder weapon to make everyone believe that he was hit there. When asked by Ran why she killed Shinsuke, Fumiko revealed that she worried his plans for the company would make everyone greedy and not care about the quality of their product, responding to employee Daisuke Kosugi's argument that none of them were like that by revealing that she believed they would change in time under Shinsuke's plan. When Satoshi expressed remorse for not firing Shinsuke before, Fumiko expressed understanding with Satoshi's belief that he was in Shinsuke's debt for all he'd done for the brewery and revealed her desire to be 'remembered' as the person who protected their business. After Conan deduced that Fumiko felt compelled to kill Shinsuke to repay the kindness shown to her by Satoshi's late father, Fumiko was arrested, encouraging her employees to continue their hard work in her absence as Satoshi promised to wait for her.",
