    mangaSource: "Volume 46: File 11 (479) ~REMOVE_THIS_AND_REPLACE_WITH_/N_BUT_WITH_BACKSLASHVolume 47: File 3 (482)",
    caseSolvedBy: "Conan EdogawaREMOVE_THIS_AND_REPLACE_WITH_/N_BUT_WITH_BACKSLASHKogoro Mouri",
