    characterDesign: "Mari TominagaREMOVE_THIS_AND_REPLACE_WITH_/N_BUT_WITH_BACKSLASHKeiko Sasaki (sub-character)REMOVE_THIS_AND_REPLACE_WITH_/N_BUT_WITH_BACKSLASHKumiko Shishido (design works)",
    voiceCast: "Minami Takayama as Conan Edogawa  Kappei Yamaguchi as Shinichi Kudo  Wakana Yamazaki as Ran Mouri  Akira Kamiya as Kogoro Mouri, Goro Mori  Chafurin as Juzo Megure  Wataru Takagi as Wataru Takagi  Kenichi Ogata as Hiroshi Agasa  Megumi Hayashibara as Ai Haibara  Kazuko Yanaga as Tomoko Kariya  Koichi Kitamura as Daisaku Kariya  Shozo Iizuka as Tsugutaka Kariya  Tetsuya Iwanaga as Eisuke Kariya  Yukari Honma as Motoka Aida  Tomohiro Nishimura as Shigehide Kariya  Masako Isobe as Kato  Shinobu Sato as Nakamura  Kosuke Meguro as Phone voice  Isshin Chiba as Announcer",
    openingSong: "Hoshi no Kagayaki yo",
    closingSong: "June Bride ~Anata Shika Mienai~",
    prevCase: "« Hot, Bitter, Sweet Soup",
    nextCase: "Ran's Suspicions »",
    resolution: "From Conan's hints, Kogoro, Megure, and Ran are able to solve the case and unveal the culprit identity. The person who took Tomoko's cellphone is the third son EISUKE KARIYA, who went missing after the murder of his fiance's Motoka Aida. Because cellphone only became well known during the period of ten years before the present time, Eisuke, who has been in hiding for the whole 12 year, is not well-accustomed to its function compared to his family members, thus was unable to turn it off or turn its volume down when a mail was sent to it or a call was performed. If one of the three suspects has been assisting in hiding Eisuke somewhere inside the house, then they could've had him creating an alibi for them while they went out with Tomoko to the Temuzu River and killed her. First, they remove the father Daisaku from the suspect list, as it is impossible to create an alibi regarding the smell of curry in advance due the maids only changed the meal from stew to curry 10 minutes before serving. Since it is necessary to leave the house at least 30 minutes in order to get to the location and commit the crime, this rules out that Daisaku's voice was pre-recorded in advance. Next, they deduct that Tsugutaka was unlikely to be the murderer since he took the curry into his room long after the time of murder: if he wanted to create an alibi during the time of murder, having Eisuke taking the curry into the room or taking it inside by himself after returning from the crime scene would be a more reasonable option, else if the curry was left behind he would've become the prime suspect anyway. This leave only Shigehide as the possible suspect for the crime. The group then confront Shigehide about the fact that he has been hiding his brother inside the house. Shigehide's novels are unnaturally old fashioned: none of the characters in his stories use cellphone, and characters with bleached hair also rarely appear, and only as antagonists and alike, meaning that Eisuke was actually the person who wrote the novels. Additionally, since Eisuke has been hiding inside the house's attic, then he must had heard the conversation between Tomoko and her husband and used it in one of his novel. At this point, Eisuke reveals himself and confesses to stabbing his fiancée twelve years ago after learning of her affair, though he denies of bludgeoning her to death, tipping the group off that Shigehide was actually the person who murdered Motoka and not Eisuke due to the same murder method used in the two cases, and the motive was because he was Motoka's affair partner. Because the affair took place in the family, it was discovered by Daisaku who never left the house after he was injured in the accident. The reason Tomoko was murdered in the same way was because Shigehide was trying to frame Eisuke for the crime, and the reason he had been hiding Eisuke all these years was to prevent the truth that he was actually the person who bludgeoned her to death from coming to light. Though Shigehide demands evidence connecting him to the murders, Ran reveals how Tomoko was able to find her cellphone so easily: she repeatedly sent a mail to her own cellphone with Ran's, and used the ringtone to locate it along with Eisuke. Tomoko had set her call ringtone the same as the house's phone, while the mail ringtone is the same as the doorbell in order to always find a suitable excuse to contact with her affair partner. Since the mail ringtone is now heard by them, this means that Shigehide has been hiding the Tomoko's cellphone inside his room, along with the knife used in the murder. The reason he didn't destroy the cellphone or throw it aways is because he need to confirm that Tomoko didn't expose his secrets to any of her friends and associates. Motive: Shigehide confesses that he murdered Tomoko because she demanded ¥10 million in exchange for not exposing him about the fact that he had been passing off Eisuke's novel as his own and had murdered Eisuke's fiance and framed him for the crime. As for Motoko's murder twelve years ago, he didn't planned to kill her and only went to check on her after hearing that she was stabbed by Eisuke, intending to take her to the hospital. However, when Motoka blasted that she actually intended to marry one of the brothers for money and threatened to drive him to misery after the ordeal she had suffered, he became enraged and killed her. He also reveals that he might had killed Eisuke long ago to cover up the crime, hasn't it for that he loves to read Eisuke's novels and has always been anticipated to read the next chapter.  The Aftermath: Later that night, Ran grabs a hold of Conan's phone when he drops it in the car and checks to see the message she sent to Shinichi is there.",
    mangaToAnimeChanges: [
      "The scene of Ran's imagination of Shinichi and his 'secret girlfriend' is changed to avoid sexual content: the manga has Shinchi and the girl sleeping naked in the same bed, while the anime has him goes out to buy a snack while the girl is in the car. Both scenes featuring the girl checking out Shinichi's cellphone. Also, the anime cut out the part at the Temuzu River in which Ran, in bad mood after Kogoro keep repeating the word 'cheating', screams at him that it is not cheating because (she and Shinichi) are not married.",
      "The 'secret girlfriend''s appearance appears to be an amalgamation of Ai Haibara (upper hair) and Vermouth (long wavy hair).",
      "The anime doesn't include a moment during the car ride home in the end of the case, where Ran suggest that maybe Tomoko's husband had known about his wife having an affair, since he always got in a bad mood, whenever those 'pranks' happened."
    ],
    trivia: [
      "Tomoko Kariya's car is an Iris Red Pearl 2001 Honda Fit (Honda Jazz) [GD].",
      "This is the first case that shows Conan's soccer ball cell phone strap.",
      "Sometimes in this case, Conan's cell phone appeared red, and other times, grayish."
    ],
